package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class SetScheduleAntrianResponse(	@field:SerializedName("data")	val data: DataSchedule,	@field:SerializedName("meta")	val meta: MetaSchedule)data class DataDokterSchedule(	@field:SerializedName("bidang_dokter")	val bidangDokter: String,	@field:SerializedName("code")	val code: String,	@field:SerializedName("updated_at")	val updatedAt: String,	@field:SerializedName("nama_dokter")	val namaDokter: String,	@field:SerializedName("created_at")	val createdAt: String,	@field:SerializedName("id")	val id: Int,	@field:SerializedName("photo_dokter")	val photoDokter: String)data class DataSchedule(	@field:SerializedName("shiff")	val shiff: String,	@field:SerializedName("jam_praktek_id")	val jamPraktekId: String,	@field:SerializedName("tanggal_pendaftaran")	val tanggalPendaftaran: String,	@field:SerializedName("antrian")	val antrian: String,	@field:SerializedName("dokter")	val dokter: DataDokterSchedule,	@field:SerializedName("transaksi")	val transaksi: String,	@field:SerializedName("updated_at")	val updatedAt: String,	@field:SerializedName("user_id")	val userId: Int,	@field:SerializedName("dokter_id")	val dokterId: String,	@field:SerializedName("created_at")	val createdAt: String,	@field:SerializedName("id")	val id: Int,	@field:SerializedName("keluhan")	val keluhan: String)data class MetaSchedule(	@field:SerializedName("code")	val code: Int,	@field:SerializedName("message")	val message: String,	@field:SerializedName("status")	val status: String)